Important information about children's sleep and a sleep diary in one app.
Ideas and tips on how to quickly put your baby to sleep and reduce the number of night awakenings, how to teach a child to fall asleep in his or her crib, how to avoid rocking him or her to sleep, how to separate breastfeeding and sleep. The app is designed for young parents and can replace an expensive sleep consultant.

The sleep diary allows you to monitor your baby's sleep and awake time.
It brings the ability to mark your baby's daytime and nighttime sleep.
Add tags to sleep (diaper, feeding, where baby fell asleep, fast asleep).
Add comments to sleep.

The sleep counter automatically calculates and displays:
⁃ Total sleep time for the day;
⁃ Total awake time for the day;
⁃ Current sleep time;
⁃ How long the child has been awake since the last sleep;
⁃ Number of daytime naps;
⁃ Number of night sleeps.

The sleep tracker charts output statistics and show
⁃ Total sleep time;
⁃ Total awake time;
⁃ Total daily sleep time;
⁃ Total night sleep time;
⁃ Morning wake-up time;
⁃ Bedtime.

Приложение ЕМИАС.ИНФО предоставляет запись к врачам в городские поликлиники Москвы и доступ к электронной медкарте.

Возможности:
- запись на прием к врачу, просмотр/отмена/перенес записей;
- запись к специалистам по направлениям;
- запись на лабораторные исследования по назначениям;
- просмотр выписанных рецептов;
- автоматические напоминания о записях на прием;
- возможность подключить несколько полисов ОМС.
- электронная медицинская карта (осмотры врача, анализы, исследования, выписки) 
- возможность включить отправку данных из Apple Здоровье/Apple Health (пульс, давление, уровень глюкозы, уровень насыщения крови кислородом и температуру) в ЕМИАС

Для просмотра медкарты необходимо оформить доступ к карте на портале mos.ru.

Для записи к врачу необходимо иметь:

1. Полис ОМС, зарегистрированный в Москве;
2. Прикрепление в любой Московской поликлинике.

Уточнить вопросы по полису и прикреплению можно по телефону +7 (495) 539-30-00.

===ВАЖНО===
Приложение подключается к информационной системе ЕМИАС, получая из нее информацию о расписании врачей, ваших текущих записях/направлениях, отправляет запрос на новую запись или перенос, поэтому приложение не может влиять на следующие ситуации:

•    Недоступна информационная система ЕМИАС или в ней идут технические работы;
•    Отсутствует (исчезло) прикрепление к конкретной поликлинике;
•    Полис ОМС отсутствует в базах городского фонда ОМС

напишите нам в обратную связь прямо из приложения, мы сможем проверить и подсказать в чем проблема.

Если вы недовольны качеством и доступностью медицинской помощи в поликлинике:
•    отсутствует необходимый врач/специальность;
•    нет доступного времени для записи;
•    исчезли (отменили в поликлинике) сделанные записи;
•    очереди в поликлиниках или долгое ожидание приема;
•    некачественное обслуживание со стороны врачей или регистратуры;

необходимо обращаться на горячую линию Департамента здравоохранения г. Москвы (+7 (495) 777-77-77), в ведении которого находится организация работы городских поликлиник.

The simplest program to track breastfeeding, pumping, bottle feeding, solid food consumption, diapers, sleep schedule, height and weight, and more.

With the click of a button, your feedings and baby care history will be stored in the app. You will have an easy-to-maintain history of your baby’s growth.

The birth of a baby is a miracle that fills your heart with joy! A mother’s life changes dramatically with the birth of her baby. It is so important for a mother and her newborn baby to establish a comfortable breastfeeding relationship.  Moms need to keep track of which breast to offer her baby, how long the baby suckles at each breast, the number of times the baby breastfeeds each day, how many wet diapers and bowel movements the baby has, how long and frequently the baby sleeps, as well as the baby’s weight and growth.  All of this information is important for the self-assessment of breastfeeding and for assessing the growth of the child.  Having this information easily accessible will be extremely useful when visiting with your pediatrician or lactation consultant.

It is important to record all of this data. Do not rely on your memory, because even the most organized mothers are often lost in the sea of information about their newborn.

Use the features of the Breastfeeding application.

Breastfeeding and pumping:
- record the time and quantity of feedings and/or pumpings;
- note which breast was fed or pumped last to ensure starting new feeding/pumping on the opposite breast;
- record the duration of feeding/pumping;
- pause feeding/pumping, if necessary;
- quickly add feeding/pumping session that was similar to the most recent but updates with the current time
- use the maximum duration of feeding setting and the application will stop recording the feeding/pumping at the set time if you are unable to press stop

Liquids:
- consider all of your child’s fluid intake (water, expressed breast milk, formula, juice, etc.);
 -track your child’s reactions to new fluids and leave comments for yourself and other caregivers;
- set the default fluid volume (can be edited as needed);

Feeding (solid food):
- add solid foods as your child begins eating them (cereal, vegetables, fruits, meat, fish);
- track your child’s reactions to these new foods and leave comments for yourself and other caregivers
- set the default fluid volume (can be edited as needed);

Sleep:
- record the time and duration of your baby’s sleep each day so you can better plan your day;
- compare your baby’s sleep habits with recommended sleep guidelines

Diapers: 
- track the number of your baby’s wet and/or dirty diapers. This information is crucial for noticing signs of dehydration, constipation, and diarrhea and alerting the child’s pediatrician if necessary.

Measurements: 
- track height and weight to evaluate your baby’s development;

Other features:
- edit or delete events as needed;
- set reminders for various events; 
- use the application in your native language;
- select your preferred units of measurement;
- view statistics;
- enter data for several children and twins;
- backup all of your data;

Also available in PRO-version:
- disable advertising;	
- auto backup every 24 hours;	
